import './App.css';

import React from 'react';
import ReactDOM from 'react-dom';
import { VictoryLine, VictoryChart, VictoryTheme } from 'victory';


const data = [
  {y: 13000},
  {y: 16500},
  {y: 2352},
  {y: 2432},
  {y: 423424},
  {y: 16500},
  {y: 234235},
  {y: 6464},
  {y: 42342},
  {y: 1214},
  {y: 52255},
  {y: 56332}
];



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='Graph'>
      <VictoryChart
  theme={VictoryTheme.material}
>
  <VictoryLine
    style={{
      data: { stroke: "#c43a31" },
      parent: { border: "1px solid #ccc"},

    }}
    data={data}
  />
</VictoryChart>
</div>
      </header>
    </div>
  );
}

export default App;
